package pacificsoft.pscomandera.Modelo;import java.io.Serializable;import java.util.List;public class ComandaArticuloRequest implements Serializable {    private String COD_ART;    private String DES_PRO;    private double CAN_PRO;    private String NOTA = "";    private int NUM_CTA;    private double PRE_ART;    private List<ComandaModificador> Modificadores;    public ComandaArticuloRequest() {    }    public ComandaArticuloRequest(String COD_ART, String DES_PRO, double CAN_PRO, String NOTA, int NUM_CTA) {        this.COD_ART = COD_ART;        this.DES_PRO = DES_PRO;        this.CAN_PRO = CAN_PRO;        this.NOTA = NOTA;        this.NUM_CTA = NUM_CTA;    }    public String getCOD_ART() {        return COD_ART;    }    public void setCOD_ART(String COD_ART) {        this.COD_ART = COD_ART;    }    public String getDES_PRO() {        return DES_PRO;    }    public void setDES_PRO(String DES_PRO) {        this.DES_PRO = DES_PRO;    }    public double getCAN_PRO() {        return CAN_PRO;    }    public void setCAN_PRO(double CAN_PRO) {        this.CAN_PRO = CAN_PRO;    }    public String getNOTA() {        return NOTA;    }    public void setNOTA(String NOTA) {        this.NOTA = NOTA;    }    public int getNUM_CTA() {        return NUM_CTA;    }    public void setNUM_CTA(int NUM_CTA) {        this.NUM_CTA = NUM_CTA;    }    public double getPRE_ART() {        return PRE_ART;    }    public void setPRE_ART(double PRE_ART) {        this.PRE_ART = PRE_ART;    }    public List<ComandaModificador> getModificadores() {        return Modificadores;    }    public void setModificadores(List<ComandaModificador> modificadores) {        Modificadores = modificadores;    }}